/*  eslint-disable*/
function ProfileCard({ title, handle, image }) {
  return (
    <div className="card">
      <div className="img">
        <img src={image} alt={title}/>
      </div>
      <div> Title is {title}</div>
      <div> Handle is {handle} </div>
    </div>
  );
}
export default ProfileCard;
